    nhterm:originalText "MADRID -- Catalonia's outgoing regional president has called on voters to advance the cause of separatism from Spain after the country's Supreme Court barred him from office for disobeying the country's electoral law. The top court's ruling earlier on Monday upheld a previous decision to remove Quim Torra as the chief of the northeastern region for refusing to remove a banner that called for the release of imprisoned separatist leaders and was displayed on a public building before the 2019 general election. The ruling has triggered a new period of political uncertainty in the northeastern region where a demand by some for independence has caused the country's biggest constitutional crisis in decades. According to the existing regulations, Torra's deputy Pere Aragones should take over as president-in-charge until the regional parliament elects a new leader or a new election is held. Pro-secession activists reacted by calling for protests later Monday in the regional capital, Barcelona. 'No unjust law applied for the purpose of revenge against those who defend human and universal rights will ever be able to defeat democracy,' Torra said in a televised address surrounded by members of his Cabinet, including Aragones. He also called on Catalans to turn the next regional election into a de-facto plebiscite on independence by voting for separatists and vowed to take his appeal against Monday's ruling to European courts. 'The only way forward is by democratically breaking away,' he said. Spanish Deputy Prime Minister Carmen Calvo told reporters that the deadlock should be resolved with a new election as soon as possible in order to reactivate dialogue between the regional and central authorities. 'The sooner Catalonia is ready to have the ability to work with the government of Spain, the better for everybody,' Calvo said. In their ruling, the panel of judges unanimously agreed to uphold last year's decision by a lower court to ban Torra from holding any public office for 18 months and fine him 30,000 euros ($35,000). Torra, a staunch separatist, became the head of Catalonia's government following the 2017 push for the region's independence that resulted in Spain removing then-regional president Carles Puigdemont, who fled to Belgium and has been fighting off extradition to Spain since then. 'Once more, the Spanish state interferes in our democratic institutions,' Puigdemont wrote in a tweet. Torra had remained at the helm of Catalonia during the appeal but Monday's decision must be implemented even if the case is taken to the European Court of Human Rights, as pledged by Torra's defence team. The banner at the centre of the case referred to a dozen former Catalan Cabinet members, lawmakers and activists who were imprisoned or left Spain following a declaration of independence in October 2017. The court on Friday said Torra had 'stubbornly' disobeyed the country's electoral board by refusing to take it down from a balcony in the regional government's headquarters. In hearings, Torra and his defence lawyers had argued that he was defending the higher cause of political and human rights. But the Supreme Court judges said that the electoral board's order didn't violate Torra's right to free speech, only limited what he could do in his role as an elected official. Polls and election results show that the 7.5 million residents of Catalonia, a wealthy northeastern region, are roughly equally split on the question of whether it should become independent from Spain."^^xsd:string ;
