    nhterm:originalText "Two Iranian border guards have been killed by armed narco-traffickers in Khuzestan province in the southwest of the country. A captain and a sergeant major were gunned down in the firefight which occurred in the Hour-al-Azim region in Dasht-e Azadegan County. Another Iranian border guard was wounded in the shootout and taken to hospital. He underwent treatment and his general condition is satisfactory at the moment. No further details about the incident are available at this point."^^xsd:string ;
